	(4715, 0, 'es', 'labels', 'backend.lessons.video_guide', '<p class = "mb-1"> <b> Youtube: </b> Vaya a Youtube -> Vaya al video que desea visualizar -> haga clic en el botón Compartir debajo del video. Copia los enlaces y pégalos en el cuadro de texto anterior </p>\n<p class = "mb-1"> <b> Vimeo: </b> Vaya a Vimeo -> Vaya al video que desea mostrar -> haga clic en el botón Compartir y copie la URL del video aquí </p>\n<p class = "mb-1"> <b> Subir: </b> Subir <b> mp4 </b> en la entrada del archivo </p>\n<p class = "mb-1"> <b> Incrustar: </b> Copiar / Pegar código de inserción en el cuadro de texto anterior </p>', '2020-12-15 01:28:49', '2022-02-12 19:38:42'),
	(4716, 0, 'es', 'labels', 'backend.lessons.remove', 'Retirar', '2020-12-15 01:28:49', '2022-02-12 19:38:42'),
	(4717, 0, 'es', 'labels', 'backend.lessons.enter_video_url', 'Introducir datos de video', '2020-12-15 01:28:49', '2022-02-12 19:38:42'),
	(4718, 0, 'es', 'labels', 'backend.lessons.enter_video_embed_code', 'Ingrese el código de inserción de video', '2020-12-15 01:28:49', '2022-02-12 19:38:42'),
	(4719, 0, 'es', 'labels', 'backend.lessons.vimeo_note', '<b> Instrucciones para agregar el enlace del video: </b> <br> Vaya a vimeo -> abrir video -> haga clic derecho en el video y <b> Copiar URL del video </b> y péguelo aquí. <br> Si desea para agregar varios videos, luego sepárelos con <b>, </b> (coma) Firmar.', '2020-12-15 01:28:49', '2022-02-12 19:38:42'),
	(4720, 0, 'es', 'labels', 'backend.lessons.yt_note', '<b> Instructions pour ajouter un lien vidéo: </b> <br> Allez sur youtube -> ouvrir la vidéo -> faites un clic droit sur la vidéo et <b> Copier l\'URL de la vidéo </b> et collez-le ici. <br> Si vous voulez pour ajouter plusieurs vidéos, séparez-les par <b>, </b> (Virgule).', '2020-12-15 01:28:49', '2022-02-12 19:38:42'),
