	(5143, 1, 'es', 'labels', 'backend.update.note_before_upload', '<p> <b> Realice BACKUP antes de actualizar. </b> El archivo zip actualizado puede incluir nuevas carpetas y actualizaciones de archivos. <b> Sus archivos actuales serán reemplazados por uno nuevo </b>. Por lo tanto, <b> si ha realizado algún cambio en los archivos de la aplicación actual, se PERDERÁ </b>. </p>\n                         <p> Si está cargando directamente desde el cuadro de entrada de archivo inferior, sus archivos serán reemplazados. Le recomendamos encarecidamente que realice la sustitución manual de los archivos uno por uno o edite los cambios comparando su archivo editado actual y los nuevos archivos actualizados. </p>\n                         <p> Si todavía tienes confusión. Póngase en contacto con nosotros, le guiaremos para actualizar su aplicación </p>', '2020-12-15 01:28:52', '2020-12-15 01:28:52'),
	(5144, 0, 'es', 'labels', 'backend.update.note_before_upload_title', 'Lea las siguientes notas antes de actualizar', '2020-12-15 01:28:52', '2022-02-12 19:38:47'),
