	(5146, 0, 'es', 'labels', 'backend.update.upload', 'Subir nueva versión <small> (update.zip) </small>', '2020-12-15 01:28:52', '2022-02-12 19:38:47'),
	(5147, 0, 'es', 'labels', 'backend.update.warning', '<b> ADVERTENCIA: le recomendamos encarecidamente que actualice el tema por el número de versión </b>. <br> <b> Ejemplo: </b> update_v1.zip, update_v2.zip. Por favor, no saltar el número de versión. Si su número de versión es 1 y desea actualizarlo, entonces actualice a la versión 2. No actualice directamente a la versión 3.', '2020-12-15 01:28:52', '2022-02-12 19:38:47'),
