	(6790, 0, 'fr', 'labels', 'backend.lessons.video_guide', '<p class = "mb-1"> <b> Youtube: </b> Allez sur Youtube -> Allez à la vidéo que vous souhaitez afficher -> cliquez sur le bouton Partager en dessous de la vidéo. Copiez ces liens et collez-les dans la zone de texte ci-dessus </p>\n<p class = "mb-1"> <b> Vimeo: </b> Aller à Vimeo -> Aller à la vidéo que vous souhaitez afficher -> cliquez sur le bouton Partager et copiez l\'URL de la vidéo de collage ici </p>\n<p class = "mb-1"> <b> Transférer: </b> Transférer un fichier <b> mp4 </b> dans l\'entrée de fichier </p>.\n<p class = "mb-1"> <b> Incorporer: </b> copier / coller le code intégré dans la zone de texte ci-dessus </p>', '2020-12-15 01:29:09', '2022-02-12 19:38:55'),
