	(6793, 0, 'fr', 'labels', 'backend.lessons.enter_video_url', 'Entrer des données vidéo', '2020-12-15 01:29:09', '2022-02-12 19:38:55'),
	(6794, 0, 'fr', 'labels', 'backend.lessons.vimeo_note', '<b> Instructions pour ajouter un lien vidéo: </b> <br> Allez à vimeo -> ouvrir la vidéo -> cliquez avec le bouton droit sur la vidéo et <b> Copier l\'URL de la vidéo </b> et collez-le ici. <br> Si vous le souhaitez pour ajouter plusieurs vidéos, séparez-les par <b>, </b> (Virgule).', '2020-12-15 01:29:09', '2022-02-12 19:38:55'),
	(6795, 0, 'fr', 'labels', 'backend.lessons.yt_note', '<b> Instructions pour ajouter un lien vidéo: </b> <br> Allez sur youtube -> ouvrir la vidéo -> faites un clic droit sur la vidéo et <b> Copier l\'URL de la vidéo </b> et collez-le ici. <br> Si vous voulez pour ajouter plusieurs vidéos, séparez-les par <b>, </b> (Virgule).', '2020-12-15 01:29:09', '2022-02-12 19:38:55'),
