	(7218, 1, 'fr', 'labels', 'backend.update.note_before_upload', '<p> <b> Veuillez effectuer une sauvegarde avant la mise à jour. </b> Un fichier zip mis à jour peut être fourni avec de nouveaux dossiers et mises à jour de fichiers. <b> Vos fichiers actuels seront remplacés par de nouveaux </b>. Ainsi, <b> si vous avez apporté des modifications aux fichiers de l\'application en cours, ce sera PERDU </b>. </p>\n                         <p> Si vous téléchargez directement depuis la zone de saisie de fichier ci-dessous, vos fichiers seront remplacés. Nous vous recommandons vivement de procéder au remplacement manuel des fichiers un par un ou de modifier les modifications en comparant votre fichier modifié actuel et les nouveaux fichiers mis à jour. </p>\n                         <p> Si vous avez encore de la confusion. S\'il vous plaît contactez-nous, nous vous guiderons pour mettre à jour votre application </p>', '2020-12-15 01:29:13', '2020-12-15 01:29:13'),
	(7219, 0, 'fr', 'labels', 'backend.update.note_before_upload_title', 'Lire les notes suivantes avant la mise à jour', '2020-12-15 01:29:13', '2022-02-12 19:38:57'),
	(7220, 0, 'fr', 'labels', 'backend.update.title', 'Thème de mise à jour', '2020-12-15 01:29:13', '2022-02-12 19:38:57'),
	(7221, 0, 'fr', 'labels', 'backend.update.upload', 'Télécharger la nouvelle version <small> (update.zip) </small>', '2020-12-15 01:29:13', '2022-02-12 19:38:57'),
	(7222, 0, 'fr', 'labels', 'backend.update.warning', '<b> AVERTISSEMENT: nous vous recommandons vivement de mettre à jour le thème par numéro de version </b>. <br> <b> Exemple: </b> update_v1.zip, update_v2.zip. S\'il vous plaît ne sautez pas le numéro de version. Si votre numéro de version est 1 et que vous souhaitez le mettre à jour, passez à la version 2. Ne mettez pas à jour directement à la version 3.', '2020-12-15 01:29:13', '2022-02-12 19:38:57'),
